        /*-----------------------------
    1. GENERIC CSS AND RESET
    2. LP CSS
    3. TERMS OVERLAY
    4. CARRIERS OVERLAY
    5. SERVICE DESCRIPTION DCB
-----------------------------*/

        /*-----------------------------
    1. GENERIC CSS AND RESET
-----------------------------*/

        *,
        *:before,
        *:after {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            color: #eaeaea;
            background: #181818;
            font-family: 'Helvetica', sans-serif;
            font-size: 10px;
        }

        input[type="submit"],
        input[type="text"],
        input[type="tel"] {
            -webkit-appearance: none;
        }

        input[type="submit"]:focus,
        input[type="tel"]:focus,
        button:focus {
            outline: none;
        }

        a {
            color: inherit;
        }

        img {
            border: none;
        }

        /*-----------------------------
    2. LP CSS
-----------------------------*/

        #lp_wrapper {
            text-align: center;
            width: 100%;
            max-width: 480px;
            margin: auto;
        }

        .header {
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 5px 5px 0 5px;
        }

        .header img {
            max-width: 80px;
        }

        .header svg {
            height: 32px;
        }

        .header p {
            font-size: 28px;
            font-weight: bold;
            color: #d6973d;
        }

        .girls_row {
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 5px;
        }

        .girl_row_wrapper {
            position: relative;
            width: 80px;
        }

        .girl_row_img {
            -webkit-clip-path: circle(50% at 50% 50%);
            clip-path: circle(50% at 50% 50%);
            -webkit-shape-outside: circle(50% at 50% 50%);
            shape-outside: circle(50% at 50% 50%);
            border-radius: none;
            border: 2px solid #FE0417;
        }

        .girl_row_img {
            width: 75px;
            height: 75px;
            position: relative;
            overflow: hidden;
            border-radius: 50%;
        }

        .girl_row_img img {
            max-width: 75px;
        }

        .girl_row_wrapper span {
            height: 15px;
            width: 15px;
            background-color: #00ff06;
            border-radius: 50%;
            position: absolute;
            top: 0;
            right: 10px;
        }

        .main_image img {
            width: 90%;
            text-align: center;
        }

        .main_text {
            font-size: 18px;
            font-weight: bold;
            margin: 10px 0;
        }

        .main_text.wpsent {
            position: relative;
            margin-top: 40%;
        }

        h1 {
            font-size: 26px;
            color: #FE0417;
        }

        .lp_form {
            background: #454545;
            border-radius: 10px;
            padding: 5px;
            width: 96%;
            margin: 5px auto;
        }

        .label {
            font-size: 18px;
            margin: 5px 0 5px 0;
            font-weight: 300;
        }

        input[type=tel] {
            font-size: 18px;
            max-width: 280px;
            border: none;
            border-radius: 50px;
            outline: none;
            width: 100%;
            padding: 20px 20px;
            display: block;
            margin: 20px auto 5px auto;
            border: 1px solid gray;
            transition: all .4s;
            animation: shadow-pulse 1.5s infinite;
        }

        @keyframes shadow-pulse {
            0% {
                box-shadow: 0 0 0 0px rgba(254, 4, 23, 0.7);
            }

            100% {
                box-shadow: 0 0 0 20px rgba(254, 4, 23, 0.0);
            }
        }

        input[type=tel]:focus {
            border: 1px solid #2fbd21 !important;
            box-shadow: 0 8px 5px rgba(0, 173, 93, 0.2);
            max-width: 340px;
            width: 90%;
            animation: none;
        }

        .adult_reminder {
            font-size: 16px;
            margin: 10px auto 5px auto;
            font-style: italic;
        }

        .adult_reminder span {
            color: #FE0417;
            font-weight: bold;
        }

        .submit_bt {
            background: #FE0417;
            border: none;
            border-radius: 50px;
            color: white;
            font-size: 20px;
            font-weight: bold;
            text-transform: uppercase;
            margin: 10px auto 5px auto;
            max-width: 320px;
            width: 100%;
            outline: none;
            padding: 20px 10px;
            -webkit-animation-name: button;
            -webkit-animation-duration: 3s;
            animation-name: button;
            animation-duration: 3s;
            animation-iteration-count: infinite;
            animation-delay: 0s;
            position: relative;
            box-shadow: 0px 5px 10px rgba(0, 0, 0, 0.2);
            display: block;
            text-decoration: none;
        }

        .bt_icon {
            width: 40px;
            height: 40px;
            position: absolute;
            left: 10px;
            top: 50%;
            transform: translateY(-50%);
        }

        .offnet {
            animation: none;
        }

        @keyframes button {
            0% {
                left: -10px;
            }

            5% {
                left: 10px;
            }

            10% {
                left: -5px;
            }

            15% {
                left: 5px;
            }

            20% {
                left: 0px;
            }

            100% {
                left: 0px;
            }
        }

        #msisdn_error {
            font-size: 16px;
            margin: 10px auto 0 auto;
            display: none;
            color: red;
        }

        .price {
            margin: 10px auto 0;
            display: block;
            text-align: center;
            font-size: 12px;

            line-height: 12px;
            color: #ffffff;
            font-weight: 700;

            position: absolute;
            bottom: 3px;
            left: 50%;
            transform: translateX(-50%);
        }

        /*@media (max-height: 715px) {*/
        /*    .price {*/
        /*        position: relative;*/
        /*    }*/
        /*}*/

        .exit_bt {
            display: block;
            text-decoration: none;
            background-color: #eee;
            font-size: 14px;
            color: #000;
            max-width: 120px;
            margin: 0 auto 10px auto;
            padding: 7px;
            border-radius: 5px;
            text-align: center;
        }

        .terms {
            text-align: center;
            margin: 10px auto;
            font-size: 12px;
        }

        .terms a {
            text-decoration: underline;
        }

        #antifraud_badge {
            display: none;
        }

        /*-----------------------------
    3. TERMS OVERLAY
-----------------------------*/

        #overlay {
            display: none;
            background-color: rgba(0, 0, 0, 0.4);
            position: fixed;
            width: 100%;
            height: 100%;
            top: 0px;
            left: 0px;
            text-align: center;
            z-index: 110;
        }

        .disc {
            position: absolute;
            width: 90%;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 111;
            background: #fff;
            color: #000;
            padding: 30px;
            text-align: center;
            max-width: 480px;
        }

        .disc p.terms_title {
            font-size: 20px;
            margin: 10px auto;
        }

        .disc p.terms_text {
            font-size: 12px;
            text-align: left;
            margin-bottom: 10px;
        }

        .disc p a {
            color: inherit;
        }

        .close_btn {
            right: 5px;
            top: 5px;
            float: right;
            border: none;
            position: absolute;
        }

        .close_terms {
            width: 100%;
            padding: 10px 0;
            margin: 0 auto;
            background: transparent;
            color: #000;
            border: 4px solid black;
            border-radius: 50px;
            font-weight: bold;
            font-size: 16px;
        }

        /*-----------------------------
    4. CARRIERS OVERLAY
-----------------------------*/

        #lp_screen {
            position: fixed;
            top: 0;
            left: 0;
            z-index: 1011;
            height: 100%;
            width: 100%;
            background-color: rgba(0, 0, 0, 0.5);
            text-align: center;
            display: none;
        }

        .screen_wrapper {
            background-color: #fff;
            border-radius: 10px;
            padding: 20px;
            max-width: 360px;
            width: 90%;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 1111;
        }

        .loader_small {
            height: 0;
            width: 0;
            padding: 20px;
            border-radius: 50px;
            -webkit-animation: rotate 1s infinite linear;
            position: relative;
            text-align: center;
            margin: 10px auto;
            border: 4px solid #d0d0d0;
            border-right-color: #FE0417;
        }

        @-webkit-keyframes rotate {

            100% {
                -webkit-transform: rotate(360deg);
            }
        }

        #loader_access p {
            color: #FE0417;
            font-size: 18px;
            font-weight: bold;
            margin-bottom: 15px;
        }

        #screen p {
            color: #000;
            font-size: 16px;
            line-height: 24px;
        }

        .bold {
            font-weight: bold;
        }

        /*-----------------------------
    5. SERVICE DESCRIPTION DCB
-----------------------------*/

        #service {
            padding: 5px;
            text-align: center;
            display: flex;
            flex-wrap: wrap;
            align-items: center;
            justify-content: space-between;
        }

        #service img, #service svg {
            display: inline-block;
            height: 35px;
            opacity: 0.6;
        }

        #service p {
            font-size: 10px;
            color: inherit;
            font-weight: bold;
            border-radius: 100%;
            border: 1px solid #fff;
            padding: 6px 4px;
            opacity: 0.6;
            margin: 3px 0;
        }

        #service p:first-of-type {
            padding: 0 4px;
            border: none;
            font-size: 29px;
            line-height: 1;
        }

        hr {
            border: 1px solid #FE0417;
        }


        /*---------------------*/
        input{
            display: inline-block;
            min-width: 200px;
            width: 80%;
            max-width: 370px;
            min-height: 30px;
            margin-top: 10px;
            padding-left: 25px;
            padding-right: 25px;
            font-family: "Open Sans", sans-serif;
            font-size: 22px;

            height: 63px;

            border-radius: 37px;
            background-color: #ffffff;
            border: 5px solid #fe0417;

            margin-bottom: 4px;
        }
        input::placeholder {
            font-family: "Open Sans", sans-serif;
            font-size: 22px;
            font-weight: 400;
            color: #000000;
        }

        input:focus-visible {
            outline: none;
        }

        .text {
            font-size: 24px;
            line-height: 12px;
            color: #ffffff;
            margin-top: 20px;
            margin-bottom: 12px;
        }


        /*=============================*/

        @media only screen
        and (min-device-width: 375px)
        and (max-device-width: 667px)
        and (-webkit-min-device-pixel-ratio: 2)
        and (orientation: portrait)
        {
            #service {
                /*padding: 2px;*/
            }
            h1 {
                font-size: 18px;
                line-height: 1;
            }
            .text {
                margin-top: 6px;
                margin-bottom: 6px;
            }
            input {
                height: 45px;
            }
            .submit_bt {
                padding: 10px 10px;
            }
            .main_image img {
                width: 80%;
            }
            .girl_row_img {
                width: 60px;
                height: 60px;
            }
            .label {
                font-size: 14px;
                line-height: 1;
                margin: 0;
            }
            #service p:first-of-type {
                font-size: 22px;
            }
            .main_image img {
                width: 60%;
            }
        }
    </style>
